INSERT INTO `ivca_template_food` (`id`, `building_facilities_a`, `building_facilities_b`, `building_facilities_c`, `building_facilities_d`, `building_facilities_e`, `equipment_a`, `equipment_b`, `equipment_c`, `personnel_a`, `personnel_b`, `personnel_c`, `raw_materials_a`, `raw_materials_b`, `raw_materials_c`, `raw_materials_d`, `raw_materials_e`, `production_a`, `production_b`, `production_c`, `production_d`, `production_e`, `production_f`, `records_a`, `records_b`, `records_c`, `records_d`, `labeling_a`, `labeling_b`, `labeling_c`, `status`, `status_by`, `created_by`, `created_at`, `updated_at`) VALUES
(1, 'a) Building used in the manufacture or storage of product are designed and constructed to permit unobstructed placement of equipment, orderly storage of materials, sanitary operation, and proper cleaning and maintenance (2,0)', 'b) Floors, walls and ceiling are constructed of smooth, easily cleanable surfaces and are kept clean and in good repair  (2,0)', 'c) Fixtures, ducts and pipes are installed in such a manner that drip or condensate does not contaminate materials, utensils, product contact surfaces of equipment or finished product (2,0)', 'd) Lighting and ventilation are sufficient for the intended operation and comfort of personnel (2,0)', 'e) Water supply, washing and toilet facilities, floor drainage and sewage system are adequate for sanitary operation and cleaning of facilities, equipment and utensils, as well as to satisfy employee needs and facilitate personal cleanliness (2,0)', 'a) Equipment and utensils used in processing, holding, transferring and packing are appropriate design, material and workmanship to prevent corrosion, buildup of material, or adulteration with lubricants, dirt or sanitizing agent (2,0)', 'b) Utensils, transfer piping and product contact surfaces of equipment are well maintained and clean and are sanitized at appropriate intervals (2,0)', 'c) Cleaned and sanitized portable equipment and utensils are stored and located, and product contact surfaces of equipment are covered, in a manner that protect them from splash, dust or other contamination (2,0)', 'a) The personnel supervising or performing the manufacture or control of product has the education, training and/or experience to perform the assigned functions(2,0)', 'b) Persons coming into direct contact with product materials, finished goods or product contact surfaces, to the extent necessary to prevent adulteration of product, wear  appropriate outer garments, gloves, hair restraints etc., and maintain adequate personal cleanliness(2,0)', 'c) Consumption of food or drink, or use of tobacco is restricted to appropriately designated area(2,0)', 'a) Raw materials and primary packaging materials are stored and handled in a manner which prevents their mix-up, contamination with microorganisms or other chemicals, or decomposition from exposure to excessive heat, cold, sunlight or moisture (2,0)', 'b) Containers of materials are closed, and bagged or boxed materials are stored off the floor(2,0)', 'c) Containers of materials are labeled with respect to identity, lot identification and control status(2,0)', 'd) Materials are sampled and tested or examined in conformance with procedures assuring the absence of contamination with filthy, microorganisms or other extraneous substances to the extent necessary to prevent adulteration of finished products. Pay particular attention to materials of animal or vegetable origin and those used in the manufacture of product by cold processing method with respect to contamination with faith or micro organisms(2,0)', 'e) Contaminated materials, spoiled materials, materials not meeting acceptance specification are properly identified and controlled to prevent their miss use in production and prevent from contamination to the other product and product contact surface(2,0)', 'a) The production are controlled with written instruction for processing , in process control etc. (2,0)', 'b) the equipment for processing including the container are clean, in good repair and in sanitary condition. (2,0)', 'c) Weighting and measuring of materials is regularly checked, verified or calibrated with identification tag. Container for holding materials are properly identified (2,0)', 'd) Major equipment, containers, tanks are identified to indicate contents, batch designation, control status and other pertinent information (2,0)', 'e) Labels are examined for identify before labeling operation to avoid mix-up (2,0)', 'f) Packages of finished product bear permanent code marks (2,0)', 'a) Raw materials and primary packaging materials, documenting disposition of rejected materials (2,0)', 'b) Manufacturing of batches, documenting the kinds, Lots and quantities of material used processing, handling, transferring, holding Sampling, controlling, adjusting and reworking Code marks of batched and finished goods (2,0)', 'c) Finished goods equipped with label and control status (2,0)', 'd) Distribution, documenting initial interstate shipment, code marks and consignees (2,0)', 'a) In addition to the product name, statements of identity and net contents are provided (2,0)', 'b) Name and address of the firm manufacturing the product or introducing it into market (2,0)', 'c) any direction for safe use of product (2,0)', NULL, NULL, 25, '2021-10-26 11:34:03', '2021-10-26 11:34:03');
